import Category from "../components/Common-components/CategoryIphones";
import SpecialHeader from "../components/Common-components/SpecialHeader";
import ProductCard from "../components/ProductCard";
import { useEffect, useState, useContext, createContext } from "react";
import Skeleton from "../components/Skeleton/Skeleton";

function Iphones(params) {
  const [data, setData] = useState([]);
  const url = "http://localhost:8080/product";
  const [isLoading, setIsLoading] = useState(false);
  // const [page, setPage] = useState(0);
  // const [size, setSize] = useState(9);
  // const [totalPages, setTotalPages] = useState(0);
  const [model, setModel] = useState([]);
  const [memory, setMemory] = useState([]);
  const [price, setPrice] = useState("");

  return (
    <>
      <SpecialHeader></SpecialHeader>
      <div className="mainPhoneContainer">
        <div className="phoneContainer">
          <div className="categoryIphones">
            <Category></Category>
          </div>
          <div className="iphoneSection">
            <div className="iphoneContainer">
              {params.isLoading ? [... new Array(6)].map((_, index) => <Skeleton></Skeleton>) : params.data != null ? params.data.map((obj) => <ProductCard key={obj.id} {...obj}></ProductCard>) : null}
            </div>
            <div className="pagination">
              {params.totalPages !== 0 ? [...new Array(params.totalPages)].map((obj, index) => <button onClick={() => setPage(index)}>{index + 1}</button>) : null}
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default Iphones;
